import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class PublicoService {

  private valorUsuario: any; // Variable para almacenar el valor
  private indice: number;
  registros: string[] = [
    '20030361',
    '20060102',
    '20171111',
    '20090388',
    '201602560',
    '20200391',
    '20100086',
    '20160311',
    '20020819',
    '19990735',
    '20101934'
  ];

  constructor() { 
    this.valorUsuario = null;
    this.indice = 0;
  }

  getRegistro(): any {
    return this.valorUsuario;
  }

  setRegistro():void {
    this.indice = Math.floor(Math.random() * 10);
    this.valorUsuario = this.registros[this.indice];
  }

  setValor(valor:any):void {
    this.valorUsuario = valor;
  }
}
